import { Card, Col, Container, Row } from "react-bootstrap";
import Accordion from "react-bootstrap/Accordion";
import "./accord.css";
export default function Accord({ props }) {
  console.log(props);
  return (
    <Row className="card">
      <Col lg={10}>
          <h5>{props.title}</h5>
      </Col>
      <Col >
        <i class="bi bi-trash"></i>
      </Col>
    </Row>
  );
}
